
DROP TABLE IF EXISTS `geo_cities`;
CREATE TABLE `geo_cities` (
	`id` int(11) unsigned NOT NULL AUTO_INCREMENT,
	`name` varchar(255) NOT NULL,
	`country_id` integer(10) UNSIGNED NOT NULL DEFAULT 0,
	`state_id` integer(10) UNSIGNED NOT NULL DEFAULT 0,
	`zone_id` integer(11) UNSIGNED NOT NULL DEFAULT 0,
	`latitude` decimal(14,11) DEFAULT 0.00,
	`longitude` decimal(14,11) DEFAULT 0.00,
	`created_at` datetime DEFAULT NULL,
	`updated_at` datetime DEFAULT NULL,
	PRIMARY KEY (`id`),
	KEY `geo_cities_country_id_foreign` (`country_id`),
	CONSTRAINT `geo_cities_country_id_foreign` FOREIGN KEY (`country_id`) REFERENCES `geo_countries` (`id`),
	KEY `geo_cities_state_id_foreign` (`state_id`),
	CONSTRAINT `geo_cities_state_id_foreign` FOREIGN KEY (`state_id`) REFERENCES `geo_states` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


